        <Box sx={{
            bgcolor:'yellow',
            width:'35rem'
        }}>
            <TextField sx={{width:'100%',height:'10px'}} fullWidth label="" id="fullWidth" />
            <Box>
                <SearchIcon/>
            </Box>
        </Box>
    )
}

export default menu
